import React from 'react';
import './SearchBar.css';

const SearchBar = (props) => {
  return (
    <div clasName="searchbar">
      <input
        className="search_input"
        type="text"
        id="search"
        placeholder="Search"
      ></input>
      <button type="submit" className="searchbutton"></button>
    </div>
  );
};

export default SearchBar;
